import React from 'react';

class Header extends React.Component {
  render() {
    return (
      <div className='header'>
        <div className='header-logo'>
          <img src='https://www.google.com/imgres?imgurl=https%3A%2F%2Fupload.wikimedia.org%2Fwikipedia%2Fja%2Fe%2Fea%2FLandolt_ring_0.png&imgrefurl=https%3A%2F%2Fja.wikipedia.org%2Fwiki%2F%25E8%25A6%2596%25E5%258A%259B&docid=XCaO_3smZDvMxM&tbnid=bxpsRuGxtH5XkM%3A&vet=10ahUKEwiGhtPjlsXiAhU9x4sBHclhDiMQMwiQASgOMA4..i&w=800&h=800&bih=821&biw=1440&q=%E8%A6%96%E5%8A%9B&ved=0ahUKEwiGhtPjlsXiAhU9x4sBHclhDiMQMwiQASgOMA4&iact=mrc&uact=8' />
        </div>
        <h2>視力回復カレンダー</h2>
      </div>
    );
  }
}

export default Header;
